import { Layout } from "antd";
import Title from "antd/lib/skeleton/Title";

const { Header, Footer, Sider, Content } = Layout;

const HomePage = () => {
  return (
    <Layout>
      <Content>
         <div>
           <Title>Tianjian (Frost) Xu</Title>
         </div>
      </Content>
      <Footer>Footer</Footer>
    </Layout>
  );
};

export default HomePage;
